import React from "react";
import {useState} from 'react';
import StarRating from './starrating'

export default class ReviewForm extends React.Component {

    constructor(props){
        super(props);

        this.state = {
            review: {
                name: props.name,
                review: props.review,
                rating: {StarRating}
            }
        }
    }

}
